import React, { useState } from 'react';
import './App.css';
import './index.css';

function App() {
  const [selectedPrice, setSelectedPrice] = useState("3000");
  const [stripeLink, setStripeLink] = useState("https://book.stripe.com/cN2eX4gBJ7oPfQY000");

  const handleAccommodationChange = (e) => {
    const selectedOption = e.target.options[e.target.selectedIndex];
    setSelectedPrice(selectedOption.value);
    setStripeLink(selectedOption.getAttribute('data-stripe-link'));
  };

  const redirectToStripe = () => {
    window.location.href = stripeLink;
  };

  const addToCart = () => {
    alert("Item added to cart!");
  };

  return (
    <div className="homepage">
      <header className="site-header">
        <h1>My Alkaline Vegan Journey</h1>
        <img src={require('./images/logo.png')} alt="MAVJ Logo" className="site-logo" />
      </header>

      <section className="booking-section">
        <div className="border-wrapper">
          <h2>Choose Your Accommodations</h2>
          <form onSubmit={(e) => { e.preventDefault(); redirectToStripe(); }}>
            <label>
              Select Accommodation Type - St. Lucia 7 Days ALL INCLUSIVE:
            </label>
            <select onChange={handleAccommodationChange} value={selectedPrice}>
              <option value="3000" data-stripe-link="https://book.stripe.com/cN2eX4gBJ7oPfQY000">Four Man Tent/p - $3000</option>
              <option value="3200" data-stripe-link="https://book.stripe.com/dR6eX4gBJ9wXeMU7su">Two Man Tent/p - $3200</option>
              <option value="3350" data-stripe-link="https://book.stripe.com/aEU8yG1GP4cD0W4aEH">One Man Tent/p - $3350</option>
              <option value="3500" data-stripe-link="https://book.stripe.com/00g6qyadlbF5cEMaEI">Air BnB Style Suite/p - $3500</option>
              <option value="3800" data-stripe-link="https://book.stripe.com/9AQaGObhpbF50W4eUZ">Guest Home/p - $3800</option>
            </select>
            <p>Price: ${selectedPrice}</p>
            <div className="buttons">
              <button type="submit">Book Now</button>
              <button type="button" onClick={redirectToStripe}>Go to Stripe</button>
              <button type="button" onClick={addToCart}>Add to Cart</button>
            </div>
          </form>
        </div>
      </section>

      <section className="product-section">
        <div className="product-box">
          <h2>St. Lucian Volcanic Wild Crafted Sea Moss Gel – 16oz</h2>
          <p>Boost your immunity with our 100% Wild Crafted Sea Moss Gel.</p>
          <a href="https://buy.stripe.com/test_seamoss123" target="_blank" rel="noopener noreferrer">
            <button>Buy Now – $85 + Shipping</button>
          </a>
        </div>

        <div className="product-box">
          <h3>Volcanic St. Lucian Solar/Lunar Infused Black Castor Oil – 4oz</h3>
          <p>* Created in sync with natural planetary rhythms
* Infused with solar fire, lunar memory, and earth resonance
* Handcrafted without synthetic machinery, chemicals, or interference
* Holds ancestral intention and energetic imprint
* A true living extract — not just topical, but vibrational medicine
This oil isn’t just for skin or hair. It’s a medicinal conduit — a way for your body to remember its original healing blueprint through contact with a substance carrying memory, rhythm, and purpose.</p>
          <a href="https://buy.stripe.com/test_castoroil456" target="_blank" rel="noopener noreferrer">
            <button>Buy Now – $225 + Shipping</button>
          </a>
        </div>
      </section>
    </div>
  );
}

export default App;
